import React from 'react';
import ResponsiveNavBar from "../Partials/Header"
import SearchForm from '../utils/SearchForm';





function Home() {

  
  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex-grow py-2 px-8 drop-shadow-xl text-black font-sans">

      {/* home section */}
      <div class="relative bg-transparent px-8 overflow-hidden ">
        <div className='absolute right-12 bottom-30 max-w-3xl'>
          <img src='asset_home.svg' alt="Background" className=''/>
        </div>
        <div class="relative max-w-4xl py-12 px-8 sm:py-20 sm:px-8 lg:px-12">
          <div className='max-w-2xl'>
          <h1 class="font-extrabold sm:text-6xl">
          Travel   <span className='border-b-8 border-teal-500'>comfortably</span>, with <span className='border-b-8 border-teal-500'>trusted</span> people,  and at the<span className='border-b-8 border-teal-500'> lowest </span> price!
          </h1>
          <p class="mt-8 text-lg leading-6 "><span className='text-teal-700 font-semibold'>+ 400,000</span>  members trust Us and carpool every day, everywhere in Morocco</p>
          </div >
          <div className='pl-8 text-black'>

          <SearchForm />
          </div>
              
          </div>
        </div>
        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Home;
